import Form from './components/Form'; // Ajusta la ruta según la estructura de tu proyecto
import Result from './components/Resultado'; // Ajusta la ruta según la estructura de tu proyecto
import Header from './components/Header';
import getFinalBudget from './Helper'; // Ajusta la ruta según la estructura de tu proyecto
import datos from './datos.json'; // Ajusta la ruta según la estructura de tu proyecto

const App = () => {
  const [budgetObj, setBudgetObj] = useState(null);

  return (
    <div>
      {/* Encabezado */}
      <Header title="COTIZADOR DE SEGUROS" />
      {/* Formulario */}
      <Form setBudgetObj={setBudgetObj} />

      {/* Resultado */}
      {budgetObj && <Result budgetAmount={getFinalBudget(2000, datos)} />}

      {/* Otros componentes o contenido si es necesario */}
    </div>
  );
};

export default App;
